import React from "react";

const Signing = () => {
  return (
    <div className="flex h-screen w-full justify-center items-center ">
      <div>
        <form action="">
          <label>Property Name</label>
          <input type="text" className=" px- bg-gray-50" />
        </form>
      </div>
    </div>
  );
};

export default Signing;
